import React from 'react';
import { DiHtml5 } from "react-icons/di";

const SkillItem = ({ title, Icon }) => (
    <li className="mb-3">
        <strong className="o-font-md font-weight-normal">{title}</strong>
        <h1><Icon/></h1>
    </li>
);
class Skills extends React.Component{

    state = {
        skills: [
            {id: 1, title: 'HTML5', icon: DiHtml5}, 
            {id: 2, title: 'NODEJS', icon: DiHtml5},
        ]
    }

    render(){
        return(
            <>
                <ul className="list-unstyled mb-5 o-grid">
                    {
                        this.state.skills.map(item => (
                            <SkillItem key={item.id} {...item} />
                        ))
                    }
                </ul>
            </>
        );
    }
}

export default Skills;
